window.bookSummaryJSON = "<p>This is the way the world ends, for the last time. </p> <p>The season of endings grows darker, as civilization fades into the long cold night. </p> <p>Essun - once Damaya, once Syenite, now avenger - has found shelter, but not her daughter. Instead there is Alabaster Tenring, destroyer of the world, with a request. But if Essun does what he asks, it would seal the fate of the Stillness forever. </p> <p>Far away, her daughter Nassun is growing in power - and her choices will break the world. </p>"; 
